INSERT INTO `show` VALUES (169, '2018 [A CLASSIC TOUR 学友·经典]世界巡回演唱会 南昌站', 'brand_1519880719.jpg', '<p></p><table class=\"m-table2\" width=\"700\"><tbody><tr class=\"firstRow\"><td width=\"90\" class=\"bg\" data-spm-anchor-id=\"a2o6e.project.0.i3.78606304tWQ2jv\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">演出时间</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">2018.03.04</td><td width=\"90\" class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">演出场馆</td><td width=\"200\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">Modernsky lab上海</td></tr><tr><td><br/></td><td><br/></td><td><br/></td><td><br/></td></tr><tr><td><br/></td><td><br/></td><td><br/></td><td><br/></td></tr><tr><td><br/></td><td><br/></td><td><br/></td><td><br/></td></tr><tr><td><br/></td><td><br/></td><td><br/></td><td><br/></td></tr><tr><td><br/></td><td><br/></td><td><br/></td><td><br/></td></tr><tr><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">限购</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">选座购买每单限6张，立即购买每单限20张。</td><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">儿童入场提示</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">儿童一律凭票入场</td></tr><tr><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">禁止携带物品</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">食品、饮料、相机、充电宝、打火机等。</td><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">付款时效提醒</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">购票下单成功后需在15分钟内完成支付，未支付成功的订单，将在下单15分钟后系统自动取消，所选价位将自动释放后重新点亮，大家可及时刷新购票页面进行购买。</td></tr><tr><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">缺货登记提醒</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">所需票价若为灰色，说明已经售完。您可以在当前页面进行缺货登记，后期如果有票会以短信形式及时通知。</td><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">发票说明</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">如需发票，请您在演出前通过订单页补开，发票将在演出结束后1个月左右，统一由主办方提供</td></tr><tr><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">座位类型</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">本项目无座位</td><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">退换说明</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">本项目为全国联网销售，与现场座位一一对应，具有时效性。任何退换票行为都将影响剧场方、项目主办方及其他观众的正当权益。如因个人特殊情况无法按时观看，还请自行处理，为观众带来不便，敬请谅解！</td></tr></tbody></table><p><br/></p><p></p><h4 data-spm-anchor-id=\"a2o6e.project.0.i4.78606304tWQ2jv\" style=\"margin: 25px 0px; padding: 0px 6px; height: 36px; line-height: 36px; color: rgb(51, 51, 51); background-color: rgb(238, 238, 238); font-family: 宋体; white-space: normal;\">演出介绍</h4><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">玫瑰花语</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">红玫瑰:我爱你、热恋，希望与你泛起激情的爱</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">白玫瑰:纯洁、谦卑、尊敬, 我们的爱情是纯洁的</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">红与白玫瑰:彼此共有</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">独家企划，红白玫瑰</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">风中的低语</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">烈火中的坚强</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">站在世界之巅的少女们</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">用梦想汗水坚持铸就自己的秘密花园</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">守护内心的玫瑰</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">红与白</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">只为霎那间的绽放</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">粉丝表白，惊喜互动</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">VIP观众将获得独家限定生写</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">有机会为演出成员献上白玫瑰</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">并抽取第五届总决选演唱会兑换券</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">全场观众均可参加活动抽奖赢取限量版礼品</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">有趣的互动游戏和搞笑话题也将由粉丝决定</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">双城双队，重生首秀</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">SNH48大重组之后在咪咕音乐现场的首场演出</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">上海站首发阵容独家揭秘</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">刘佩鑫、郝婉晴、沈梦瑶、王奕、谢妮、许杨玉琢、袁一琦、张昕</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">以及更大惊喜</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">… …</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">广州站将由恩兔成员强势助阵</span></p><p><br/></p><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\"><br/></span></p>', 0, 1, 1, 0, 0);
