统一由主办方提供</td></tr><tr><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">座位类型</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">本项目无座位</td><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">退换说明</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">本项目为全国联网销售，与现场座位一一对应，具有时效性。任何退换票行为都将影响剧场方、项目主办方及其他观众的正当权益。如因个人特殊情况无法按时观看，还请自行处理，为观众带来不便，敬请谅解！</td></tr></tbody></table><br/></p><h4 data-spm-anchor-id=\"a2o6e.project.0.i4.78606304tWQ2jv\" style=\"margin: 25px 0px; padding: 0px 6px; height: 36px; line-height: 36px; color: rgb(51, 51, 51); background-color: rgb(238, 238, 238); font-family: 宋体; white-space: normal;\">演出介绍</h4><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">玫瑰花语</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">红玫瑰:我爱你、热恋，希望与你泛起激情的爱</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">白玫瑰:纯洁、谦卑、尊敬, 我们的爱情是纯洁的</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">红与白玫瑰:彼此共有</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">独家企划，红白玫瑰</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">风中的低语</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">烈火中的坚强</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">站在世界之巅的少女们</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">用梦想汗水坚持铸就自己的秘密花园</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">守护内心的玫瑰</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">红与白</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">只为霎那间的绽放</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">粉丝表白，惊喜互动</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">VIP观众将获得独家限定生写</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">有机会为演出成员献上白玫瑰</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">并抽取第五届总决选演唱会兑换券</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">全场观众均可参加活动抽奖赢取限量版礼品</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">有趣的互动游戏和搞笑话题也将由粉丝决定</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">双城双队，重生首秀</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">SNH48大重组之后在咪咕音乐现场的首场演出</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">上海站首发阵容独家揭秘</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">刘佩鑫、郝婉晴、沈梦瑶、王奕、谢妮、许杨玉琢、袁一琦、张昕</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">以及更大惊喜</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">… …</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">广州站将由恩兔成员强势助阵</span></p><p><br/></p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><br/></span>', 0, 1, 1, 0, 0);
