nd-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">红与白玫瑰:彼此共有</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">独家企划，红白玫瑰</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">风中的低语</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">烈火中的坚强</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">站在世界之巅的少女们</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">用梦想汗水坚持铸就自己的秘密花园</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">守护内心的玫瑰</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">红与白</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">只为霎那间的绽放</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">粉丝表白，惊喜互动</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">VIP观众将获得独家限定生写</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">有机会为演出成员献上白玫瑰</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">并抽取第五届总决选演唱会兑换券</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">全场观众均可参加活动抽奖赢取限量版礼品</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">有趣的互动游戏和搞笑话题也将由粉丝决定</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">双城双队，重生首秀</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">SNH48大重组之后在咪咕音乐现场的首场演出</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">上海站首发阵容独家揭秘</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">刘佩鑫、郝婉晴、沈梦瑶、王奕、谢妮、许杨玉琢、袁一琦、张昕</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">以及更大惊喜</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">… …</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">广州站将由恩兔成员强势助阵</span></p><p><br/></p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><br/></span>', 0, 1, 1, 0, 0);
