ine-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">缺货登记提醒</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">所需票价若为灰色，说明已经售完。您可以在当前页面进行缺货登记，后期如果有票会以短信形式及时通知。</td><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">发票说明</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">该项目发票由主办方提供，一般演出结束后1个月左右开出，发票开具出会以短信通知，届时可以到大麦网合肥站门店自取。</td></tr><tr><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">温馨提示：</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">学生票需凭学生证至安徽大剧院窗口购买<br/>购票及入场均需出示本人学生证</td><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">退换说明</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">本项目为全国联网销售，与现场座位一一对应，具有时效性。任何退换票行为都将影响剧场方、项目主办方及其他观众的正当权益。如因个人特殊情况无法按时观看，还请自行处理，为观众带来不便，敬请谅解！</td></tr><tr><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">活动说明</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">目前此项目不支持客户端专享的优惠活动。</td><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\"><br/></td><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\"><br/></td></tr></tbody></table><p><br/></p><p><br/></p><h4 style=\"margin: 25px 0px; padding: 0px 6px; height: 36px; line-height: 36px; color: rgb(51, 51, 51); background-color: rgb(238, 238, 238); font-family: 宋体; white-space: normal;\"><span data-spm-anchor-id=\"a2o6e.project.0.i3.781f18edWIwzbA\">内容简介</span></h4><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">迄今为止21世纪最有影响力的当代戏剧</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">全国50座城市超过300场次演出 屡次登上票房三甲</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">演出5年观演人数超过100万人次</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">电影全国排片500000+场次 影响60000000+观众 票房斩获1.72亿</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">一部靠口碑相传的“神作”</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">一部饱受争议的作品</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">一部值得你进剧场一看再看的戏剧</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">《驴得水》不仅仅是一出话剧，还是一件文化事件</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><h4 style=\"margin: 25px 0px; padding: 0px 6px; height: 36px; line-height: 36px; color: rgb(51, 51, 51); background-color: rgb(238, 238, 238); font-family: 宋体; white-space: normal;\">故事梗概</h4><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">民国时期的一个乡村学校，由于严重缺水，校长将一头驴虚报成英语老师，来为学校挑水。面临上级的检查，大家决定让一个铁匠来冒充这个叫&quot;驴得水&quot;的英语老师。但是上级却对这位&quot;驴&quot;老师刨根问底。眼看事情要败露，大家只能用更多的谎言去弥补。于是，事件的发展越来越超乎校长和老师们的预料。</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp;</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/9923931e-5c58-46b7-bc68-13469a110f00\" width=\"550\" height=\"344\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/9923931e-5c58-46b7-bc68-13469a110f00\" style=\"border: 0px; display: inline;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/4aae9cc2-80dc-4875-b21e-d6b916b8fbde\" width=\"550\" height=\"344\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/4aae9cc2-80dc-4875-b21e-d6b916b8fbde\" style=\"border: 0px; display: inline;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\">&nbsp;</p><h4 style=\"margin: 25px 0px; padding: 0px 6px; height: 36px; line-height: 36px; color: rgb(51, 51, 51); background-color: rgb(238, 238, 238); font-family: 宋体; white-space: normal;\">精彩看点</h4><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">至乐汇口碑佳作《驴得水》被许多剧迷称作“神剧”，该剧的舞美制作还原了民国时期的场景，但不仅仅是场景，人设与关系、灯光与音效和舞美也把观众们带回了多年前。虽然服装和道具与现代相差甚远，但不变的是对人性的剖析与拷问。它不露锋芒的尖刻和智慧的表达深入人心，是一部幽默中有酸楚，荒诞中有反思的作品。</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/899fa6a3-8495-49e5-8ea1-455224a8a351\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/899fa6a3-8495-49e5-8ea1-455224a8a351\" style=\"border: 0px; display: inline;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/3d7fab01-b157-4ed7-ba91-c6211fbc98ef\" width=\"550\" height=\"344\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/3d7fab01-b157-4ed7-ba91-c6211fbc98ef\" style=\"border: 0px; display: inline;\"/></p><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp;</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">极端的情境凸显了人性的复杂，剧中荒诞不经的故事、黑色幽默的讽刺、尖锐不留情面的影射准确无误地戳中了观众们的神经。</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">喜爱《驴得水》的观众们将其称之为“神剧”、“舞台上的《让子弹飞》”、“话剧界的《泰囧》”，这些称号不仅是因为本剧良好的口碑和引发的热议，同时也反映了《驴得水》的票房奇迹。</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">有人说，它是近年话剧界最具诚意的一部作品，也有人说，它是80后新锐剧作者在世俗之外的一次集体回归。它没有虚无缥缈的天马行空，也没有离经叛道的肆意妄为，却更像一杯浓烈的苦茶，在初始的甜蜜后，是苦苦的回味。</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/edfb6393-9403-44f8-beb3-71af01787175\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/edfb6393-9403-44f8-beb3-71af01787175\" style=\"border: 0px; display: inline;\"/></p><p><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><h4 style=\"margin: 25px 0px; padding: 0px 6px; height: 36px; line-height: 36px; color: rgb(51, 51, 51); background-color: rgb(238, 238, 238); font-family: 宋体; white-space: normal;\">主创</h4><p><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/d9b87fc9-202b-494e-a665-ba72e584bc3a\" width=\"295\" height=\"392\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/d9b87fc9-202b-494e-a665-ba72e584bc3a\" style=\"border: 0px; display: inline;\"/></p><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">导演/编剧：周申</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">2006年独立指导小剧场话剧《朱丽小姐》联合导演话剧《三姊妹》</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">2007年（商业展示）自编自导小型音乐短剧《浪漫夜晚》</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">联合导演小剧场话剧《秃头歌女》</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">2008年编剧并联合导演音乐浪漫喜剧《如果，我不是我》</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><p><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/8d7b3c8a-88dc-44dd-a459-c1efaad00e7b\" width=\"337\" height=\"388\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/8d7b3c8a-88dc-44dd-a459-c1efaad00e7b\" style=\"border: 0px; display: inline;\"/>&nbsp;</p><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">导演/编剧：刘露</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">中央戏剧学院</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">导演系本科、导演系研究生</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">代表作：</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">《三姊妹》《秃头歌女》《如果我不是我》</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/024d457e-096d-4ebb-a5a5-16f8d916f02d\" width=\"550\" height=\"344\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/024d457e-096d-4ebb-a5a5-16f8d916f02d\" style=\"border: 0px; display: inline;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">制作人：孙恒海</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">至乐汇创始人/艺术总监</p><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">当代中国最具有影响力的戏剧制作人。他所制作的戏剧故事情节丰满，思辨性极强，看过他的戏剧的人都会为他所表现的那种独到，睿智，辛辣，荒诞思想折服。</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">代表作品：</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">舞台剧《驴得水》、《破阵子》、《六里庄艳俗生活》、《高手》、《思奔》、《东北往事》、《大圣归来》、《左耳》、《单身男女》、《三人行不行》、《吉祥公寓1802》、《一个演员的自我修养》、《老佛爷的爷》、《大前门》、《一出梦的戏剧》、《狐狸小晶》、《民国那些事儿》、《奇葩啪》、《遇见心想事成的自己》、《笨贼一箩筐》、《土豪的一千零一夜》、《狂奔的拖鞋》、《喜地的牙》等……</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><h4 style=\"margin: 25px 0px; padding: 0px 6px; height: 36px; line-height: 36px; color: rgb(51, 51, 51); background-color: rgb(238, 238, 238); font-family: 宋体; white-space: normal;\">口碑</h4><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/a4f08e84-b3c1-4741-90e3-b0d6bdc99288\" width=\"585\" height=\"345\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/a4f08e84-b3c1-4741-90e3-b0d6bdc99288\" style=\"border: 0px; display: inline;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/98e1342a-ffae-46e1-ac00-fb089f88e438\" width=\"559\" height=\"231\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/98e1342a-ffae-46e1-ac00-fb089f88e438\" style=\"border: 0px; display: inline;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><br/></p><h4 style=\"margin: 25px 0px; padding: 0px 6px; height: 36px; line-height: 36px; color: rgb(51, 51, 51); background-color: rgb(238, 238, 238); font-family: 宋体; white-space: normal;\">荣获奖项</h4><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">现代戏剧谷2013壹戏剧大赏•年度小剧场戏剧</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">2013杭州国际戏剧节《驴得水》导演周申、刘露获奖</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">2013壹戏剧大赏组委会对《驴得水》的评价是：</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">一出&quot;肥瘦相间、不甜不腻、辛辣有度、味道刚刚好&quot;的戏，一匹小剧场话剧市场上的&quot;黑驴&quot;。一个特别的题材在青年编导周申和刘露的精心编排下，通过干净利落的叙事节奏和情节转换，用喜剧的形式，进行严肃的探讨。音乐总监樊冲的创作，又为其增添了些风情。首演以来，该剧叫好又叫座，受到热烈追捧，如旋风般席卷全国。&quot;</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">2016 北京戏剧新势力 剧迷口碑作品</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/a829c491-b49c-4ebe-8429-d0a562981eb3\" width=\"550\" height=\"344\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/a829c491-b49c-4ebe-8429-d0a562981eb3\" style=\"border: 0px; display: inline;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><br/></p><h4 style=\"margin: 25px 0px; padding: 0px 6px; height: 36px; line-height: 36px; color: rgb(51, 51, 51); background-color: rgb(238, 238, 238); font-family: 宋体; white-space: normal;\">关于主办</h4><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">至乐汇成立7年，共创制、出品黑色幽默三部曲《驴得水》、《破阵子》、《西洋景》，以及舞台剧《东北往事》、《大圣归来》、《思奔》、《左耳》，音乐剧《狂奔的拖鞋》《高手》等25部口碑佳作。陆续完成超过1000场次演出，历年作品巡回演出超过50个城市，观众人次累计超过100万，脚步踏遍963万平方公里。囊括了包括壹戏剧奖、紫金奖等在内的国内演艺界各项荣誉，更被媒体誉为中国的“麦金托什”。至乐汇是当今中国戏剧团队中发展最快、受欢迎的文艺团队。至乐汇以高级的、精英的黑色幽默为纲，其作品表达着永不妥协的精神，勇于自嘲的生活态度。</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">代表作包括黑色荒诞喜剧《驴得水》，《三人行不行》（内地版），相声剧《六里庄艳俗生活》，《老佛爷的爷》，改编自孔二狗同名小说大型青春励志舞台剧《东北往事》，改编自萧言中同名漫画舞台剧《笨贼一箩筐》，改编自饶雪漫同名青春小说舞台剧《左耳》，以及2015年最燃动画电影改编的大型魔幻舞台剧《大圣归来》、国内首部中医题材音乐剧《高手》等。&nbsp;</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">2017年启动“一带一路 一戏一城”计划，目前于北京、上海、西安、重庆等10余城市启动，西安的《终南山》已经进入排练阶段，2018年即将上演。至乐汇致力为每一个城市做一部戏，打造一张文化新名片。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/a6c30fb3-520a-4836-9d1e-7de01aea38d1\" width=\"600\" height=\"424\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/a6c30fb3-520a-4836-9d1e-7de01aea38d1\" style=\"border: 0px; display: inline;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/27439917-fca3-4490-9e0a-ca158e29aacf\" width=\"600\" height=\"240\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/27439917-fca3-4490-9e0a-ca158e29aacf\" style=\"border: 0px; display: inline;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><br/></p><p><br/></p>', 0, 1, 1, 0, 0);
INSERT INTO `show` VALUES (173, 'John Legend 2018年中国巡回演唱会--上海站 ', 'brand_1519881284.jpg', '<table class=\"m-table2\" width=\"700\"><tbody><tr class=\"firstRow\"><td><br/></td><td><br/></td><td><br/></td><td><br/></td></tr><tr><td width=\"90\" class=\"bg\" data-spm-anchor-id=\"a2o6e.project.0.i3.6e2a70af810NnD\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">演出时间</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">2018.03.08 20:00</td><td width=\"90\" class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">演出场馆</td><td width=\"200\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">梅赛德斯-奔驰文化中心</td></tr><tr><td><br/></td><td><br/></td><td><br/></td><td><br/></td></tr><tr><td><br/></td><td><br/></td><td><br/></td><td><br/></td></tr><tr><td><br/></td><td><br/></td><td><br/></td><td><br/></td></tr><tr><td><br/></td><td><br/></td><td><br/></td><td><br/></td></tr><tr><td><br/></td><td><br/></td><td><br/></td><td><br/></td></tr><tr><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">限购</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">选座购买每单限6张，立即购买每单限20张。</td><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">儿童入场提示</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">1.2米以下儿童谢绝入场（儿童项目除外），1.2米以上儿童需持票入场。</td></tr><tr><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">禁止携带物品</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">食品、饮料、相机、充电宝、打火机等。</td><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">付款时效提醒</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">购票下单成功后需在15分钟内完成支付，未支付成功的订单，将在下单15分钟后系统自动取消，所选价位将自动释放后重新点亮，大家可及时刷新购票页面进行购买。</td></tr><tr><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">缺货登记提醒</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">所需票价若为灰色，说明已经售完。您可以在当前页面进行缺货登记，后期如果有票会以短信形式及时通知。</td><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">发票说明</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">演出结束后将不支持开具发票申请，由此给您造成的不便我们深表歉意，感谢您的理解与支持！</td></tr><tr><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\">退换说明</td><td style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229);\">本项目为全国联网销售，与现场座位一一对应，具有时效性。任何退换票行为都将影响剧场方、项目主办方及其他观众的正当权益。如因个人特殊情况无法按时观看，还请自行处理，为观众带来不便，敬请谅解！</td><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\"><br/></td><td class=\"bg\" style=\"margin: 0px; padding-top: 8px; padding-bottom: 8px; line-height: 24px; border-bottom-color: rgb(229, 229, 229); font-weight: bold; vertical-align: top; background-color: rgb(246, 246, 246); border-right-color: rgb(229, 229, 229);\"><br/></td></tr></tbody></table><p><br/></p><h4 data-spm-anchor-id=\"a2o6e.project.0.i4.6e2a70af810NnD\" style=\"margin: 25px 0px; padding: 0px 6px; height: 36px; line-height: 36px; color: rgb(51, 51, 51); background-color: rgb(238, 238, 238); font-family: 宋体; white-space: normal;\">演出介绍</h4><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">2018年3月让我们奏响生活的幸福颂歌，约翰·传奇（John Legend）时隔八年，再度归来，将中国站作为亚洲巡演的首站，可见传奇哥诚意满满，迫不及待将心中的热爱，唱给爱的你听，用声音和坚持为我们的灵魂带来最震撼的感动。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/ed8a6d7c-fc2b-4ccb-812c-5c6bc44bc0e1\" width=\"600\" height=\"400\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/ed8a6d7c-fc2b-4ccb-812c-5c6bc44bc0e1\" style=\"border: 0px; display: inline;\"/></p><p><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">他的声音有自己独有的魅力，让你身体仿佛瞬间被吸入一个他用乐曲缔造的天堂，音符化作和煦的阳光温暖你的内心，旋律化作婉旭的和风拂过你每一寸肌肤，行走在水面上泛起的涟漪洗净铅华。约翰·传奇（John Legend）一个学者型的灵魂乐歌者，他不仅仅是一名歌手，更是一个布道者，运用其声音独特的魅力把这些陈腔滥调变得特别。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/e0edaa11-6f77-460a-a5bb-f993327505cb\" width=\"600\" height=\"338\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/e0edaa11-6f77-460a-a5bb-f993327505cb\" style=\"border: 0px; display: inline;\"/></p><p><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">约翰·传奇是美国知名歌手及音乐制作人，更是一位优秀的钢琴家，在他的歌唱生涯中曾缔造1座艾美奖、1座奥斯卡奖及10座格莱美奖的辉煌纪录，他以充满感性的灵魂唱腔演绎许多脍炙人口的好歌。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/d1389814-2cec-4554-af4a-ac28c8e4ed93\" width=\"600\" height=\"337\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/d1389814-2cec-4554-af4a-ac28c8e4ed93\" style=\"border: 0px; display: inline;\"/></p><p><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">也许你不知道约翰·传奇，但是你一定认识他的灵魂，一首爱的颂歌《ALL OF ME》风靡全球，用音乐击穿了无数孤单的灵魂，全球热门电影更是邀请传奇用音乐为之润色，包揽了无数奥斯卡获奖项的影片《爱乐之城》邀请传奇参演并演唱了电影插曲《Start A Fire》,迪士尼真人版电影《美女与野兽》也邀请他献唱《Beauty and the Beast》，用声音重新编制我们童年时的美好。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/23a580ae-cb44-438f-ac22-1720e15b2ff2\" width=\"600\" height=\"320\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/23a580ae-cb44-438f-ac22-1720e15b2ff2\" style=\"border: 0px; display: inline;\"/></p><p><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">3月8日让我们齐聚上海梅赛德斯奔驰文化中心，一起来聆听这触动灵魂的音乐解药，共同演绎不一样的传奇。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/51c7bda8-457a-44c9-9daf-b4111a63e108\" width=\"600\" height=\"385\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/51c7bda8-457a-44c9-9daf-b4111a63e108\" style=\"border: 0px; display: inline;\"/></p><p><br/></p>', 0, 1, 1, 0, 0);
