p><h4 data-spm-anchor-id=\"a2o6e.project.0.i5.7e1764edSZ5k6l\" style=\"margin: 25px 0px; padding: 0px 6px; height: 36px; line-height: 36px; color: rgb(51, 51, 51); background-color: rgb(238, 238, 238); font-family: 宋体; white-space: normal;\">演出介绍</h4><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">无人可破的舞剧纪录！</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/b138ad9e-0546-4407-ad1a-dd2e5f73d816\" width=\"522\" height=\"348\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/b138ad9e-0546-4407-ad1a-dd2e5f73d816\" style=\"border: 0px; display: inline;\"/></p><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">伦敦温布利6万人体育场21场场场爆满！现场观众人数超过百万！ 并在海德公园创造一场12万人现场观看的舞剧纪录！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">无可争议的踢踏王者！</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/32a33679-ee84-4394-9c74-a782aa1dd4fc\" width=\"524\" height=\"347\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/32a33679-ee84-4394-9c74-a782aa1dd4fc\" style=\"border: 0px; display: inline;\"/></p><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">迈克尔·弗莱利创造的纪录：周薪达到惊人的160万美金，；每秒钟踢踏地面35下的“无影神脚”，全球最快；</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">无处不在的超高人气！</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/4b1e5846-9b8c-46ab-9d64-fa35f2a21f04\" width=\"254\" height=\"378\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/4b1e5846-9b8c-46ab-9d64-fa35f2a21f04\" style=\"border: 0px; display: inline;\"/></p><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">爱尔兰舞蹈协会认证的“爱尔兰舞第一人”，无人能敌！美国总统川普就职典礼上受邀表演的“踢踏王者”，克林顿亲自颁奖的“20世纪最杰出爱尔兰裔美国人”！百老汇为他在纽约42街区命名了“弗莱利大道”。</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">无法抵挡的视听盛宴！</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/cc389f07-4284-4f35-b0ba-d94ac2873904\" width=\"528\" height=\"355\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/cc389f07-4284-4f35-b0ba-d94ac2873904\" style=\"border: 0px; display: inline;\"/></p><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">他编舞的《大河之舞》《王者之舞》，大胆前卫，改变传统，把爱尔兰踢踏舞带入了全新时代，创新凯尔特音乐震撼听觉，全球视频销售超过1200万份！王者之舞已经成为壮观和震撼的代名词</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">踢踏舞最强王者［迈克尔·弗莱利］毕生杰作！</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/72e19e10-07b2-4922-8f78-81872905afdf\" width=\"522\" height=\"349\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/72e19e10-07b2-4922-8f78-81872905afdf\" style=\"border: 0px; display: inline;\"/></p><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">他是最会跳踢踏舞的男人！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">他是世所公认的踢踏舞第一王者！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">他是爱尔兰国宝舞剧《大河之舞》有杰出的舞王！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">他是吉尼斯世界 最快舞步纪录的保持者：每秒敲击地板35下！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">他是吉尼斯记录世界上收入颇高的舞蹈演员，拥有世界上保险价值最昂贵的双腿！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">他是希拉里·克林顿亲自颁奖的“20世纪最杰出爱尔兰裔美国人”！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">他是世界百名权力榜上唯一一位上榜的舞蹈家和舞蹈编导！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">他是爱尔兰舞蹈协会认证的“爱尔兰舞第一人”，被认为美国在世伟大艺术家之一！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">他是美国总统川普2016就职典礼上受邀表演的“踢踏王者”</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">他将踢踏舞带进西区与百老汇，将踢踏舞跳进全世界的体育场，点燃一轮又一轮票房奇迹！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">他是《王者之舞》的创造者与艺术总监——迈克尔·弗莱利</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">1998年，他将现代舞剧理念引入爱尔兰传统踢踏舞，创造《王者之舞》席卷世界的艺术风暴！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">2014年，迈克尔·弗莱利主导《王者之舞》再次升级为《王者之舞•危险游戏》，全新视效再次引爆全球！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">2018，《王者之舞•危险游戏》将首度登陆中国，为中国观众带来前所未有的“王者（King）体验”！</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/6e6a3d8c-26e8-4b1d-b631-a6b39c229c8c\" width=\"524\" height=\"351\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/6e6a3d8c-26e8-4b1d-b631-a6b39c229c8c\" style=\"border: 0px; display: inline;\"/></p><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">knack 舞技</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">这个舞团舞者的奖章可以铺满整个剧院舞台！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">全球top级踢踏舞精英汇聚一团！ 舞团多位舞者皆是世界踢踏舞所有年龄段冠军大满贯得主，男主James &nbsp;Keegan 七岁即获得全美锦标赛冠军，女主Caroline gray八岁即包揽全爱尔兰、大不列颠、北美和世界冠军。所有演员所获奖牌可铺满百老汇剧院舞台！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">Idea 创意</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">用百老汇的方式演绎爱尔兰历史传奇！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">用百老汇的方式让爱尔兰的传说走向全世界！取材自爱尔兰民间故事，创造故事性最丰富、戏剧张力最强的爱尔兰舞剧！为踢踏舞拓展了全新的艺术空间，让爱尔兰传统艺术进入到一个全新高度！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">New 新技术</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">全新视效技术带给视听巅峰享受！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">用最新科技让传统艺术焕发出夺目的光辉！巨型辐射平面屏幕、特效照明、超宽舞台设计、，跳舞机器人、世界杂技表演冠军的特别演出……各种精彩元素融为一体，让观众心跳加速、瞠目结舌！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">Gorgeous 精彩之音</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">皇家御用乐团只为你独享的凯尔特音乐大餐！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">英国白金汉宫音乐会御用小提琴手领衔，用现代音乐制作重新包装打造原汁原味的凯尔特音乐，创造古典与现代结合的动人旋律，让观众沉醉在音乐编织出的魔幻世界！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">《王者之舞·危险游戏》</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><h4 style=\"margin: 25px 0px; padding: 0px 6px; height: 36px; line-height: 36px; color: rgb(51, 51, 51); background-color: rgb(238, 238, 238); font-family: 宋体; white-space: normal;\">剧情梗概</h4><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/00b3d39e-4cb0-47ca-948e-062900f84e5e\" width=\"528\" height=\"353\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/00b3d39e-4cb0-47ca-948e-062900f84e5e\" style=\"border: 0px; display: inline;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">《王者之舞》的故事来源于爱尔兰传说，一个小精灵的梦想。&nbsp;</p><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">这是一个善与恶的经典故事，也是一个光明与黑暗，真理与诱惑的动人传奇。</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">在小精灵的梦中，舞蹈之王代表世界上一切美好的事物，但他必须与黑魔王和他邪恶的黑暗门徒军队作斗争。 同时舞蹈之王与他的真爱，又面临着引诱者的考验，伴随着传说中女神Erin的歌声，舞蹈之王与黑魔王展开了最后的对决！正义会战胜邪恶吗？！真爱能抵御诱惑吗？！精灵的梦会成为一场她难以醒来的噩梦吗？</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">让舞蹈拥抱你，带你走上这段充满活力和激情的旅程…</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><h4 style=\"margin: 25px 0px; padding: 0px 6px; height: 36px; line-height: 36px; color: rgb(51, 51, 51); background-color: rgb(238, 238, 238); font-family: 宋体; white-space: normal;\">巡演安排&nbsp;</h4><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img original=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/b1a1eb7b-3d3b-4df8-b4ee-69b353c3efb5\" width=\"529\" height=\"349\" alt=\"\" src=\"https://damaipimg.oss-cn-beijing.aliyuncs.com/cfs/src/b1a1eb7b-3d3b-4df8-b4ee-69b353c3efb5\" style=\"border: 0px; display: inline;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">2018年4月24至25日 天津 津湾大剧院</p><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">2018年4月27至1日 北京 展览馆剧场</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">2018年5月3至6日 上海 上汽 ·上海文化广场</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">2018年5月8至10日 苏州 苏州文化艺术中心</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">2018年5月12至13日 南京 江苏大剧院</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">2018年5月16至18日 广州 中山纪念堂</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">2018年5月19至20日 深圳 南山文体中心</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; background-color: rgb(255, 255, 255);\">九维文化 让每一个中国人都走进剧院</span></p><p><br/></p>', 0, 1, 1, 0, 0);
INSERT INTO `show` VALUES (178, ' 加拿大太阳马戏KOOZA秀-全国巡演深圳站', 'show_1522114227.jpg', '<h1 style=\"margin: 0px 0px 16px; padding: 0px; font-weight: normal; font-size: 16px; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-align: center;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; color: rgb(0, 0, 0); font-size: 36px; font-family: 宋体, SimSun;\">太阳马戏</span></h1><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\"></span></p><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; vertical-align: baseline; color: rgb(0, 0, 0); font-size: 18px;\">也许你曾在纽约、伦敦或拉斯维加斯领略过它震撼的现场，</span></p><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; vertical-align: baseline; color: rgb(0, 0, 0); font-size: 18px;\">也许你早就从互联网听闻它的种种神奇，</span></p><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; vertical-align: baseline; color: rgb(0, 0, 0); font-size: 18px;\">只是在国内，你从未亲身感受过这场全球最顶级的舞台盛宴。</span></p><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; vertical-align: baseline; color: rgb(0, 0, 0); font-size: 18px;\">这一次，机会来了。</span></p><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; vertical-align: baseline; color: rgb(0, 0, 0); font-size: 18px;\">风靡欧美30余年的太阳马戏登陆中国，120名演职人员、150分钟的精彩演出，将为中国观众带来前所未有的感官体验。</span></p><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; vertical-align: baseline; color: rgb(0, 0, 0); font-size: 16px;\">太阳马戏（法语：Cirque Du Soleil）是加拿大蒙特利尔的一家娱乐公司及表演团体，是全球最大的戏剧制作公司，也是世界最大的现场娱乐公司之一。凭借对传统马戏表演的颠覆性诠释，太阳马戏以豪华并极具震撼的舞台表现力，囊括了包括艾美奖、斑比奖等在内的国际演艺界各项最高荣誉。34年间，已为近60个国家450余座城市的1.8亿名观众演出，被誉为加拿大国宝。</span></p><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; text-indent: 0em; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; vertical-align: baseline; color: rgb(0, 0, 0); font-size: 16px;\"></span></p><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-align: center;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\"><img src=\"http://image.mydeershow.com/upload/image/20180223/1519380597921016822.png\" title=\"1519380597921016822\" alt=\"1519380597921016822\" width=\"300\" height=\"196\" border=\"0\" vspace=\"0\" style=\"margin: 0px; padding: 0px; border: 0px; width: 300px; height: 196px;\"/></span></p><p style=\"margin-top: 0px; margin-bottom: 1em; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-align: center;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; vertical-align: baseline;\">《KOOZA》秀</span></span><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; vertical-align: baseline;\"></span></span><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; vertical-align: baseline;\"></span></span></span></p><p style=\"margin-top: 0px; margin-bottom: 1em; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\">《KOOZA》秀是太阳马戏今年来华巡演的第一部“秀”，也是太阳马戏的经典作品之一。在IMDb上《KOOZA》秀的评分为8.1，在豆瓣上的评分更是高达9.0，保持了太阳马戏一贯<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;\">的高水准。从2007年加拿大首演开始，演出场次已多达3400场，超750万观众现场观看。</span></span></p><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-align: center;\"><img data-origin-width=\"977\" data-origin-height=\"214\" src=\"http://image.mydeershow.com/upload/image/20180223/1519378892636058069.png\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: middle; background: none; min-height: 1px; max-width: 100%; width: auto !important; height: auto !important;\"/></p><p style=\"margin-top: 0px; margin-bottom: 1em; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\">《KOOZA》秀的名字来源于梵文“koza”，意为“盒子里的宝藏”，讲述了一个小小的盒子衍生出巨大梦幻世界的故事。</span></p><p style=\"margin-top: 0px; margin-bottom: 1em; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\">故事的主角“小天真”拥有一个灰色的破烂风筝，却一直无法放飞。直到有一天，他收到了一个神秘的包裹，里面是一个大大的红色箱子。从红色箱子里跳出的造梦师一挥魔杖，一个奇幻的世界就这样出现在小天真面前。</span></p><p style=\"margin-top: 0px; margin-bottom: 1em; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-align: center;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\"><img data-origin-width=\"1066\" data-origin-height=\"1600\" src=\"http://image.mydeershow.com/upload/image/20180223/1519378892833099933.jpg\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: middle; background: none; min-height: 1px; max-width: 100%; width: auto !important; height: auto !important;\"/><br style=\"margin: 0px; padding: 4px 0px; display: block; content: &quot; &quot;;\"/></span></p><p style=\"margin-top: 0px; margin-bottom: 1em; padding: 0px; font-size: medium; white-space: normal; border: medium none; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\">造梦师性格迷人又世故 ，他能在《KOOZA》秀的世界随意地出现和消失，因为他就是这个奇幻世界的创造者。</span></p><p style=\"margin-top: 0px; margin-bottom: 1em; padding: 0px; font-size: medium; white-space: normal; border: medium none; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-align: center;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\"><img data-origin-width=\"1600\" data-origin-height=\"1066\" src=\"http://image.mydeershow.com/upload/image/20180223/1519378895206011874.jpg\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: middle; background: none; min-height: 1px; max-width: 100%; width: auto !important; height: auto !important;\"/><br style=\"margin: 0px; padding: 4px 0px; display: block; content: &quot; &quot;;\"/></span></p><p style=\"margin-top: 0px; margin-bottom: 1em; padding: 0px; font-size: medium; white-space: normal; border: medium none; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\">小天真则是体验者，置身于光怪陆离的视觉世界里，惊喜、恐惧和冒险交替袭来。冒险过程中，小天真遇到许多角色，诸如国王、旅行者和疯狗等等，时而欢声笑语，时而混乱危险。</span></p><p style=\"margin-top: 0px; margin-bottom: 1em; padding: 0px; font-size: medium; white-space: normal; border: medium none; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-align: center;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\"><img data-origin-width=\"2048\" data-origin-height=\"1365\" src=\"http://image.mydeershow.com/upload/image/20180223/1519378896736056174.jpg\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: middle; background: none; min-height: 1px; max-width: 100%; width: auto !important; height: auto !important;\"/><br style=\"margin: 0px; padding: 4px 0px; display: block; content: &quot; &quot;;\"/></span></p><p style=\"margin-top: 0px; margin-bottom: 1em; padding: 0px; font-size: medium; white-space: normal; border: medium none; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: 