; text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; font-size: 14px; vertical-align: baseline; color: rgb(127, 127, 127);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; vertical-align: baseline;\"></span></span></span><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline;\">《KOOZA》秀大胆摒弃了一切动物表演，将表演的重心放在挑战人类极限的艺术表演和精美的舞台视觉呈现上，把歌舞剧、特技、小丑艺术和现场配乐等融为一体，颠覆了传统马戏的演绎形式。</span></span></p><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-align: center;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\"><