ottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-align: center;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\"><img data-origin-width=\"1600\" data-origin-height=\"1274\" src=\"http://image.mydeershow.com/upload/image/20180223/1519378923574032894.jpg\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: middle; background: none; min-height: 1px; max-width: 100%; width: auto !important; height: auto !important;\"/><br style=\"margin: 0px; padding: 4px 0px; display: block; content: &quot; &quot;;\"/></span></p><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; vertical-align: baseline;\">亮点</span></span><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; vertical-align: baseline;\">3:</span></span><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; vertical-align: baseline;\">叹为观止的巨型帐篷里，</span></span><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; vertical-align: baseline;\">每一件都是精致的艺术品</span></span></span></p><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; font-size: 14px; vertical-align: baseline; color: rgb(127, 127, 127);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; vertical-align: baseline;\"></span></span></span><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline;\">《KOOZA》秀并不像普通演出那样租用现成的场地，而是在平地中搭建起巨型的黄蓝大帐篷。在帐篷里，观众就像走进一个奇幻世界，除了看秀，还可以游玩、购物、拍照或品尝美食。</span></span></p><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\">整个场地占地1.7万平方米，主帐篷的直径长达51米，可容纳2500名观众，需要150名技艺精湛的工人，花费9天时间才能搭建完成。</span></p><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-align: center;\"><img data-origin-width=\"1004\" data-origin-height=\"640\" src=\"http://image.mydeershow.com/upload/image/20180223/1519378924814024182.png\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: middle; background: none; min-height: 1px; max-width: 100%; width: auto !important; height: auto !important;\"/></p><p style=\"margin-top: 0px; margin-bottom: 1em; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\">整场演出有多达 175 套服装和 160 顶帽子，总共 1080 件服装配件。这些演出服装全部采用全手工定制 ，每一件都力求精致，仅仅一套军装就用了 400 多个单独缝制的金属薄片来做出那种全副武装的效果。即便是一顶假发的制作时间也要高达60个小时，使得发丝与发丝之间根根分明。</span></p><p style=\"margin-top: 0px; margin-bottom: 1em; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-align: center;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\"><img data-origin-width=\"1600\" data-origin-height=\"1120\" src=\"http://image.mydeershow.com/upload/image/20180223/1519378929108073654.jpg\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: middle; background: none; min-height: 1px; max-width: 100%; width: auto !important; height: auto !important;\"/></span></p><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(127, 127, 127);\"></span><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; font-size: 14px; vertical-align: baseline;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; vertical-align: baseline;\">亮点4：前所未有的视听盛宴，6位音乐家现场配乐</span></span></span><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; font-size: 14px; vertical-align: baseline; color: rgb(127, 127, 127);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; vertical-align: baseline;\"></span></span><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; vertical-align: baseline;\"></span></span></span></span></p><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\">帐篷内的KOOZA世界奇幻而多彩。圆形舞台提供了260度的绝佳视野，所有的表演都在简单透明的开放场景中完成，以便让观众们的注意力全部集中在表演者的身上。最主要的布景是一座名为巴塔克兰的移动高塔，设计灵感来自于印度教文化和珠宝，塔上的“帆布”只需要两个人用绳索和滑轮就可以让舞台幕布自由打开和关闭。&nbsp;<br style=\"margin: 0px; padding: 0px;\"/></span></p><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-align: center;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\"><img data-origin-width=\"1167\" data-origin-height=\"1600\" src=\"http://image.mydeershow.com/upload/image/20180223/1519378930506058414.jpg\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: middle; background: none; min-height: 1px; max-width: 100%; width: auto !important; height: auto !important;\"/><br style=\"margin: 0px; padding: 4px 0px; display: block; content: &quot; &quot;;\"/></span></p><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\">为了表演的节奏感，《KOOZA》秀一直坚持现场配乐，每一场秀都是原音重现。在舞台正中央的巴塔克兰高塔上，6位音乐家演奏架子鼓、吉他、贝斯、小号、萨克斯、打击乐器和键盘，2位歌手现场演唱，为大家呈现世界顶级的舞台配乐和音效 。</span></p><p style=\"margin-top: 0px; margin-bottom: 16px; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-align: center;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\"><img data-origin-width=\"2000\" data-origin-height=\"1333\" src=\"http://image.mydeershow.com/upload/image/20180223/1519378933090001569.jpg\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: middle; background: none; min-height: 1px; max-width: 100%; width: auto !important; height: auto !important;\"/></span></p><p style=\"margin-top: 0px; margin-bottom: 1em; padding: 0px; font-size: medium; white-space: normal; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.75em; font-family: tahoma, arial, 微软雅黑, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\">3月1日起，这场让全球750万人着迷的太阳马戏经典大秀即将登陆深圳</span><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; font-size: 14px; vertical-align: baseline; color: rgb(0, 0, 0);\">。让我们一起走进《KOOZA》秀的黄蓝大帐篷，开启一段欢乐又刺激的奇幻冒险之旅吧！</span></p><p><br/></p>', 0, 1, 1, 0, 0);
